using HtmlAgilityPack;

namespace HayDayPro;

public static class GoodsSource
{
	static GoodsSource()
	{
		// Build caches
		_ = Enumerate().ToArray();
	}
	
    public static IEnumerable<Item> Enumerate()
    {
        var document = new HtmlDocument { OptionFixNestedTags = true };
        document.LoadHtml(GoodsListHtml);

        foreach (var table in document.DocumentNode.SelectNodes("//table"))
        {
            var headers = table.SelectNodes(".//tr[1]/th|.//tr[1]/td");

            if (headers is null)
                continue;

            var headerNames = headers.Select(headerNode => HtmlEntity.DeEntitize(headerNode.InnerText).Trim()).ToArray();

            foreach (var rowNode in table.SelectNodes(".//tr[position()>1]") ?? Enumerable.Empty<HtmlNode>())
            {
                var cellNodes = rowNode.SelectNodes("./th|./td");
                var cellValuesByHeader = new Dictionary<string, string>(StringComparer.OrdinalIgnoreCase);
                var columnCount = Math.Min(headerNames.Length, cellNodes.Count);

                for (var columnIndex = 0; columnIndex < columnCount; columnIndex++)
                    cellValuesByHeader[headerNames[columnIndex]] = HtmlEntity.DeEntitize(cellNodes[columnIndex].InnerText).Trim();

                yield return Item.Get(cellValuesByHeader);
            }
        }
    }

